    [T]: 'import { Override, Size } from "framer"\nimport { useEffect, useState } from "react"\nimport {\n    animate,\n    Transition,\n    useMotionTemplate,\n    useMotionValue,\n} from "framer-motion"\n\n/**\n * Hover Reveal Override for Framer by Noman (https://framercrafts.com)\n */\n\nexport function HoverReveal(): Override {\n    const [size, setSize] = useState<Size | undefined>(undefined)\n    const maskX = useMotionValue(0)\n    const maskY = useMotionValue(0)\n    const maskSize = useMotionValue(0)\n    const maskImage = useMotionTemplate`radial-gradient(circle at ${maskX}px ${maskY}px, black 0px, black ${maskSize}px, transparent ${maskSize}px)`\n\n    useEffect(() => {\n        if (!size) return\n        const transition: Transition = {\n            type: "spring",\n            stiffness: 200,\n            damping: 10,\n        }\n        const { width, height } = size\n        animate(maskSize, Math.sqrt(width * width + height * height), {\n            duration: 0.7,\n        })\n        animate(maskX, width / 2, transition)\n        animate(maskY, height / 2, transition)\n    }, [size])\n\n    return {\n        onHoverStart: () => !size && animate(maskSize, 64),\n        onHoverEnd: () => !size && animate(maskSize, 0),\n        onPointerMove: (e) => {\n            if (size) return\n            const { top, left } = e.currentTarget.getBoundingClientRect()\n            maskX.set(e.clientX - left)\n            maskY.set(e.clientY - top)\n        },\n        style: {\n            WebkitMaskImage: maskImage,\n            maskImage,\n        },\n    }\n}\n'
