    [T]: 'import type { ComponentType } from "react"\nimport React, { useState, useEffect } from "react"\n\nfunction getOS() {\n    var userAgent = window.navigator.userAgent,\n        platform = window.navigator.platform,\n        macosPlatforms = ["Macintosh", "MacIntel", "MacPPC", "Mac68K"],\n        windowsPlatforms = ["Win32", "Win64", "Windows", "WinCE"],\n        iosPlatforms = ["iPhone", "iPad", "iPod"],\n        os = null\n\n    if (macosPlatforms.indexOf(platform) !== -1) {\n        os = "Mac"\n    } else if (iosPlatforms.indexOf(platform) !== -1) {\n        os = "iOS"\n    } else if (windowsPlatforms.indexOf(platform) !== -1) {\n        os = "Windows"\n    } else if (/Android/.test(userAgent)) {\n        os = "Android"\n    } else if (/Linux/.test(platform)) {\n        os = "Linux"\n    }\n\n    return os\n}\n\nexport function OSVariant(Component): ComponentType {\n    return (props) => {\n        let [isLoading, setIsLoading] = useState(true)\n        let OS = "null"\n\n        useEffect(() => {\n            const timer = setTimeout(() => {\n                setIsLoading(false)\n            }, 500) // 2-second delay\n\n            return () => clearTimeout(timer) // cleanup\n        }, [])\n\n        if (isLoading) {\n            return null // or return a loading spinner or some placeholder\n        }\n        if (window && window.navigator) OS = getOS()\n        if (OS === "Mac") return <Component {...props} variant="Mac" />\n        if (OS === "iOS") return <Component {...props} variant="iOS" />\n        if (OS === "Android") return <Component {...props} variant="Android" />\n        if (OS === "Windows") return <Component {...props} variant="Windows" />\n        return <Component {...props} variant="Default" />\n    }\n}\n'
